import{_ as i,p as l,q as a,Y as e}from"./framework-aa5c4115.js";const r={},h=e('<h2 id="三月份" tabindex="-1"><a class="header-anchor" href="#三月份" aria-hidden="true">#</a> 三月份</h2><h3 id="今天3月5号" tabindex="-1"><a class="header-anchor" href="#今天3月5号" aria-hidden="true">#</a> 今天3月5号</h3><ul><li>好久好久没有写了，2号周六去苏州爬山了，太舒服了，喜欢那种感觉，会上瘾。</li><li>从灵岩山越过四个山头，到天平山，从天平山下去了，但是只爬了不到一半，那一片太多山了，想从头爬到末尾肯定要早上出发，就是山外有山的样子。</li><li>一路上也没吃东西，我是不习惯在景区包括车站的地方买吃的，就是因为被宰过，宰怕了，所以一般出门都是自备，不过也就只带水。</li></ul><h3 id="_03月11号" tabindex="-1"><a class="header-anchor" href="#_03月11号" aria-hidden="true">#</a> 03月11号</h3><ul><li>最近给雅晴做了个键盘，哈哈哈，情侣款算是，套件是一样的，颜色是她最喜欢的紫色，把轴都拆开润一遍，会更静音。</li><li>最近寄过去，哈哈哈哈，看起来她很期待的样子。</li></ul><h3 id="_03-15号" tabindex="-1"><a class="header-anchor" href="#_03-15号" aria-hidden="true">#</a> 03.15号</h3><ul><li>键盘不争气，可能运输问题，也可能是润轴的时候润太很了，会失灵，寄回来让我瞧瞧，晚上就到了，不过应该问题不大，争取今晚上直接再发走。</li><li>最近一周在自己琢磨小项目，打算自己写一个v3的后台模板，搞到github上，骨架已经搭好了，用的经典饿了么ui 。</li><li>周末不知道干什么，出去玩吧去哪里呢，想想。</li><li>这个月底有三天假期了，不过其实就是没放，还要调休，不知道哪个龟儿子拍板的，总理也见不到了，存在感好低。</li></ul><h3 id="_03-19号" tabindex="-1"><a class="header-anchor" href="#_03-19号" aria-hidden="true">#</a> 03.19号</h3><ul><li>键盘是超轻粘土没有晒干，今天上班大太阳，已经拿到楼上晒了，吹风机都吹不干，表面很干，一按还是软的，使劲晒晒吧。</li><li>昨天做了粉鸡汤，西红柿，绿豆芽，里脊肉，娃娃菜，菠菜，出锅放点香油，太好喝了，喝了两碗。星期天可以做鸡吃（暂定）。</li><li>vue3写的后台，不mock数据，不要权限，只要骨架，更新了一个error页面，以及echarts图表，上传到了码云。</li><li>知乎csdn上传了npm包，获取年月日十分秒，纯属玩。</li><li>最近天气好了，太阳很大，盼着星期天哈哈哈哈哈。</li><li>不知道五一买得到票不，随缘！</li></ul><h3 id="_03-22号" tabindex="-1"><a class="header-anchor" href="#_03-22号" aria-hidden="true">#</a> 03.22号</h3><ul><li>周五了，星期天要下雨，别下了，早就想洗洗被单子了，还有鞋要刷，别下了，晴两天吧。</li><li>晚上回去吃火锅哈哈哈哈，吃牛肉丸，茼蒿，馓子，自己吃火锅坏处就是吃一点就吃饱了，火锅配上可乐就更好了，但是我不喝！</li><li>这几天很热，都穿外套了，但是秋裤依旧没脱，要不然冻腿难受。</li><li>再过几分钟下班了，清明节放假还不知道干嘛嘞，还要调休，真是***!</li></ul><h3 id="_03-28号" tabindex="-1"><a class="header-anchor" href="#_03-28号" aria-hidden="true">#</a> 03.28号</h3><ul><li>今天还不是周五，一直下雨，还好上周把被子洗了一下，全是雨来不及洗。</li><li>还在弄那个svg页面，真烦人，真烦人，真烦人。</li><li>自己写的后台感觉这玩意不用权限真简单，下周三就是清明节了，不知道干啥，不知道干啥，不知道干啥。</li><li>再去爬爬山？ 要找交通方便的地方，要不然全程都在赶路了。</li></ul>',13),d=[h];function n(t,c){return l(),a("div",null,d)}const u=i(r,[["render",n],["__file","24-03.html.vue"]]);export{u as default};
